pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";

import "./mixins/roles/AdminRole.sol";
import "./mixins/roles/OperatorRole.sol";
import "./mixins/NFT721Core.sol";
import "./mixins/NFT721Creator.sol";
import "./mixins/NFT721Metadata.sol";
import "./mixins/NFT721Mint.sol";
import "./mixins/NFT721Market.sol";
import "./mixins/AccountMigration.sol";

/**
 * @title Minted NFTs implemented using the ERC-721 standard.
 * @dev This top level file holds no data directly to ease future upgrades.
 */
 
contract NftoonMain is
  AdminRole,
  OperatorRole,
  AccountMigration,
  ERC721Upgradeable,
  NFT721Creator,
  NFT721Market,
  NFT721Metadata,
  NFT721Core,
  NFT721Mint  
{
  /**
   * @notice Called once to configure the contract after the initial deployment.
   * @dev This farms the initialize call out to inherited contracts as needed.
   */
  function initialize(
    string memory name,
    string memory symbol,
    address admin
  ) public initializer {
    ERC721Upgradeable.__ERC721_init(name, symbol);
    NFT721Mint._initializeNFT721Mint();
    AdminRole._initializeAdminRole(admin);
  }

  function _baseURI() internal view virtual override(ERC721Upgradeable, NFT721Metadata, NFT721Mint) returns (string memory) {
    return GetBaseURI();
  }

  /**
   * @notice Allows a Minted admin to update NFT config variables.
   * @dev This must be called right after the initial call to `initialize`.
   */
   function adminUpdateConfig(
    address _nftMarket,
    string memory baseURI
  ) public onlyAdmin {
    _updateNFTMarket(_nftMarket);
    _updateBaseURI(baseURI);
  }

  /**
   * @dev This is a no-op, just an explicit override to address compile errors due to inheritance.
   */
  function _burn(uint256 tokenId) internal override(ERC721Upgradeable, NFT721Creator, NFT721Metadata, NFT721Mint) {
    super._burn(tokenId);
  }

   function tokenURI(uint256 tokenId) public view virtual override(ERC721Upgradeable, NFT721Metadata, NFT721Mint) returns (string memory) {
     return super.tokenURI(tokenId);
   }
  
  function supportsInterface(bytes4 interfaceId) public view virtual override( ERC721Upgradeable, NFT721Mint, NFT721Market, NFT721Metadata, AccessControlUpgradeable, NFT721Creator) returns (bool) {
    return super.supportsInterface(interfaceId);
  }
}
